import axios from "axios";
import React, {useState, useEffect} from "react";

const FC = () => {
    let [data, setData] = useState(null)

    useEffect(()=>{
        const fetchData = async()=>{
            try {
                const response = await axios.get()
                setData(response.data)
            } catch (error) {
                console.log('Error occured')
            }
        }
    })
    return(
        <>
        
        </>
    )
}
export default FC;
